function q3b(){q3b=Sbc;p3b=new r3b('XFORM',0,'Forms','http://www.youtube.com/embed/Zsa-4pUzULo','Forms are tables which organize your data into rows and columns.  You can view your forms on "Submissions" -> "Filter Submissions".<br><br>What is "Downloadable"? ("Form Management" -> "Forms List")<br>&nbsp;This setting allows remote clients to download the form. <br><br>What is "Accept Submissions"? ("Form Management" -> "Forms List")<br>&nbsp;This setting allows the form to accept data while it is in Aggregate.','How do I add a new form? (Press "New Form" on "Form Management" -> "Forms List")<br>&nbsp;1.  Form Definition - required.  Please choose the .xml file that will be used.<br>&nbsp;2.  Media File(s) - optional.  Choose the appropriate media files for the form.');n3b=new r3b(Cmc,1,Dmc,null,'Submissions are the data contained in a form.  One submission corresponds to one row in the table.','How do I upload data? (Press "Upload Data" on "Form Management" -> "Forms List")<br>&nbsp;1.  Form Definition - required.  Please choose the .xml file that will be used.<br>&nbsp;2.  Media File(s) - optional.  Choose the appropriate media files for the form.');i3b=new r3b(wjc,2,'Filters','http://www.youtube.com/embed/d4RquOGfcI0','Filters give you the ability to see a subset of your data.  For example, if you wanted to only look at males over the age of 35, you would include 2 filters: <br>&nbsp;1.  Display Rows where column Gender EQUAL male <br>&nbsp;2.  Display Rows where column Age GREATER_THAN 35<br>If you have multiple filters applied at once, then you have a filter group. <br><br>If you were more curious about viewing the distribution of locations, you could do one filter:<br>&nbsp;1.  Display columns location','How do I add a filter? (Press "Add Filter" on "Submissions" -> "Filter Submissions") <br>&nbsp;1.  Display/Hide - Will you be selecting data to show or hide?<br>&nbsp;2.  Rows/Columns - Choose whether you will be working with the rows or columns of the table.<br>&nbsp;3a.  If you selected Rows:<br>&nbsp;&nbsp;a.  Pick the column that you want to evaluate for all rows.<br>&nbsp;&nbsp;b.  Pick the operation you would like to use.<br>&nbsp;&nbsp;c.  Pick a value to use for the evaluation.<br>&nbsp;3b.  If you selected Columns:<br>&nbsp;&nbsp;a.  Pick the columns you want to either display or hide.<br>&nbsp;4.  Click "Apply Filter".<br>Unless you save it, it will be temporary.<br><br>How do I save the filter group? (Press "Save" on "Submissions" -> "Filter Submissions") <br>&nbsp;1.  Please fill in the desired name.<br>&nbsp;2.  Press "OK".');k3b=new r3b('METADATA',3,'Metadata',null,'Metadata provides information about the submissions being submitted.  There will be information such as date submitted, if the data is complete, version numbers, and id numbers','You can toggle whether or not you view metadata by clicking the "Display Metadata"checkbox on "Submissions" -> "Filter Submissions".');o3b=new r3b(Emc,4,Fmc,'http://www.youtube.com/embed/WyJD2vDc5Cg','Aggregate provides a simple web interface for basic data visualization.  <br>You can view your data in a bar graph, pie chart, or on a map.  <br>This Visualize functionality is meant to provide a quick means to view early data results <rb>in meaningful ways but is not meant to provide complex data analysis functionality. ','How do I visualize the data? (Press "Visualize" on "Submissions" -> "Filter Submissions")<br>&nbsp;1.  Choose whether you want to view a Pie Chart, Bar Graph, or a Map.<br>&nbsp;2a.  If you choose Pie Chart:<br>&nbsp;&nbsp;a.  Choose whether you would like to Count or Sum data.<br>&nbsp;&nbsp;&nbsp;Count - Counts the number of times a unique answer occurs in the specified column.<br>&nbsp;&nbsp;&nbsp;1. Select the column that you want to count.<br>&nbsp;&nbsp;&nbsp;Sum - Sums the values in one column grouped together by a value in another column.<br>&nbsp;&nbsp;&nbsp;1.  Select the column of values that you want toadd.<br>&nbsp;&nbsp;&nbsp;2.  Select the fter a certain time, or stream all of the data.  This will allow others to work with the data to do analysis.','How do I publish my data? (Press "Publish" on "Submissions" -> "Filter Submissions" or on "Form Management" -> "Forms List")<br>&nbsp;1.  Choose whether you want your data in a Google Fusion Table or a Google Spreadsheet.<br>&nbsp;2a.  If you chose Google Fusion Table:<br>&nbsp;&nbsp;a.  Choose whether you would like to upload only, stream only, or both.<br>&nbsp;&nbsp;&nbsp;1.  Upload only - This will take the current table and send it to the service.  No new data will be sent.<br>&nbsp;&nbsp;&nbsp;2.  Stream only - This will only send new data after the service is created.  No old data will be sent.&nbsp;&nbsp;&nbsp;3.  Both will send both old and new data.<br>&nbsp;&nbsp;b.  Press "Publish".<br>&nbsp;&nbsp;c.  Press "Grant Access" so that ODK Aggregate is allowed to make the file.<br>&nbsp;&nbsp;d.  You can view your published document in Google Fusion Tables.<br>&nbsp;2b.  If you chose Google Spreadsheet:<br>&nbsp;&nbsp;a.  Enter the desired name of the spreadsheet.<br>&nbsp;&nbsp;b.  Choose whether you would like to upload only, stream only, or both.<br>&nbsp;&nbsp;&nbsp;1.  Upload only - This will take the current table and send it to the service.  No new data will be sent.<br>&nbsp;&nbsp;&nbsp;2.  Stream only - This will only send new data after the service is created.  No old data will be sent.<br>&nbsp;&nbsp;&nbsp;3.  Both will send both old and new data.<br>&nbsp;&nbsp;c.  Press "Publish".<br>&nbsp;&nbsp;d.  Press "Grant Access" so that ODK Aggregate is allowed to make the file.<br>&nbsp;&nbsp;e.  You can view your published document in Google Docs.');j3b=new r3b('HELP',7,'Help','http://www.youtube.com/embed/Y9kmJeMpY38','Aggregate provides three kinds of help accessible by pressing one of three buttons in the upper righthand corner.',"&nbsp;1.  The red question mark will give you instructions for the tab you are currently viewing. When you click
